import "./ExpenseItem.css";

const date = new Date(2022, 8, 16);
const expense = "Car loan";
const amount = 5643;

function ExpenseItem() {
  return (
    <div className="expense-item">
      <div>{date} </div>
      <div>
        <h2 className="expense-item__description">{expense}</h2>
        <div className="expense-item__price">{amount} INR</div>
      </div>
    </div>
  );
}

export default ExpenseItem;
